import { useExtensionStore } from "@store";
import { extractPriceAndTime, initWorker } from "@utils";

const base64ImageURLForTime =
  "data:image/png;base64,";

const base64ImageURLForRR =
  "data:image/png;base64,";

const rrToolBase64Image =
  "data:image/png;base64,";

export async function extractTextAndSync(priceCanvas, timeCanvas, tF, updater) {
  const [worker1, worker2] = await initWorker();
  const popupUI = useExtensionStore.getState().popupUI;
  const captureMap = popupUI.captureMap;
  const riskAmount = popupUI.riskAmount;

  console.time("time");

  const getBlob = (canvas) =>
    new Promise((resolve) => {
      canvas.toBlob((blob) => resolve(blob), "image/png");
    });

  const [blob1, blob2] = await Promise.all([
    getBlob(priceCanvas),
    getBlob(timeCanvas),
  ]);

  const config = {
    tessedit_char_whitelist:
      "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789: ",
    preserve_interword_spaces: 1,
    tessedit_pageseg_mode: "11",
  };

  const [result1, result2] = await Promise.all([
    worker1.recognize(blob1, "eng", config),
    worker2.recognize(blob2, "eng", config),
  ]);

  const priceText = result1.data.text;
  const dateTimeText = result2.data.text;

  console.log(priceText, dateTimeText);

  if (priceText === "" || dateTimeText === "") {
    console.log("Please select a tool to capture!");
    console.timeEnd("time");
    return;
  }

  const data = extractPriceAndTime(priceText, dateTimeText);
  data.Pnl = riskAmount * data["Risk/Reward"];
  data["Time Frame"] = tF;

  const updatedValues = captureMap.map(({ mappingKey }) => ({
    value:
      mappingKey === "Risk/Reward"
        ? `1:${data?.[mappingKey]}`
        : data?.[mappingKey],
  }));

  updater([["captureMap", updatedValues, "update"]]);

  console.log("Text extraction start...");
  console.timeEnd("time");
}

